import Texto from "../Texto";
import Imagem from '../../images/fundo_place_holder.jpg'

const Container = styled.div`
    display: flex; 
    align-items: center; 
    background-color: white; 
    width: 100vw;
    height: 100vh;
`;

const ImageContainer = styled.div`
    width: 50%;
    padding-top: 50%; 
    position: relative;
`;

const Image = styled.img`
    width: 100%;
    height: 100%;
    object-fit: cover;
    position: absolute;

`;

const Text = styled.h2`
    width: 50%;
    font-family: "Just Me Again Down Here", cursive;
    color: white;
    font-size: 30px;
`;

function Introducao(){
    return(
        <Container>
            <ImageContainer>
                <Image src={Imagem} alt="Description"/>
            </ImageContainer>
            <Text>BLAAAAAAAAAAAAAAAAAAA</Text>
        </Container>
    )
}

export default Introducao
